"use strict";

const { BaseError } = require("uu_appg01_core-utils");
const ObjectStoreError = require("./objectstore-error.js");

class UnexpectedError extends BaseError {
  constructor(cause, message) {
    super(message || "Unexpected error occurred during operation execution.", cause);
    this.code = `${ObjectStoreError.ERROR_PREFIX}unexpectedError`;
  }
}

module.exports = UnexpectedError;
